import Typography from '@mui/material/Typography'
import { useSouqContext } from "../../app/context/SouqContext";

export default function BasketPage() {

    // const [loading, setLoading] = useState(true);
    // const [basket, setBasket] = useState<Basket|null>(null);
    //  useEffect(() => {

    //   agent.Basket.get().then(basket=>setBasket(basket))
    //   .catch(error=>console.log(error))
    //   .finally(()=>setLoading(false))
    // }, [])
    
    // if(loading)return<Loader message="Loading basket....!!!" />
      const {basket}=useSouqContext();

    if(!basket)return <Typography variant="h3" color="initial"> Basket is empty</Typography>

  return (
    <>
        <Typography sx={{mt:10}}  variant="h4" color="initial"> Buyer Id is :{basket.buyerId}</Typography>
        <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Dessert (100g serving)</TableCell>
            <TableCell align="right">Calories</TableCell>
            <TableCell align="right">Fat&nbsp;(g)</TableCell>
            <TableCell align="right">Carbs&nbsp;(g)</TableCell>
            <TableCell align="right">Protein&nbsp;(g)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>

    </>
  )
}
